func isValid(s string) string {
	var sMap = make(map[string]int)
	var iMap = make(map[int]int)
	var result = "YES"

	for _, c := range s {
		if _, ok := sMap[string(c)]; ok {
			sMap[string(c)] += 1
		} else {
			sMap[string(c)] = 1
		}
	}

	var high = sMap[string(s[0])]
	var low = sMap[string(s[0])]
	for _, i := range sMap {
		if _, ok := iMap[i]; ok {
			iMap[i] += 1
		} else {
			iMap[i] = 1
		}
		if i >= high {
			high = i
		}
		if i <= low {
			low = i
		}

	}
	fmt.Println(iMap)
	fmt.Println(len(iMap))

	fmt.Println(high)
	fmt.Println(low)

	if len(iMap) > 2 || (len(iMap) > 1 && (iMap[high] > 1 && iMap[low] > 1) || (low != 1 && (high-low) > 1)) || (((high - low) > 1) && iMap[low] > 1) {
		result = "NO"
	}

	return result
}

